import './App.css';
import Home from './Home';

function App() {
  return (
    <browser Router>
      <Routes>
        <Route path="/" element={<Home />}/>
        <Route path="Home" element={<Home />}/>
      </Routes>
    </browser>
  );
}

export default App;
